usage-and-example.html.body:
Usage & Example
Rusoto provides a crate for each AWS service it supports, containing a client
and all of the associated types for that service. A full list of these services
can be found on the Supported AWS Services page.
It also provides a core crate called rusoto_core, containing all shared
functionality across services, such as the list of regions, signed request senders,
and credential loading.
Consult the rustdoc documentatation by running cargo doc or visiting the online
API documentation for the latest crates.io release.
An example of using Rusoto's DynamoDB API to list the names of all the
tables in a database:
Cargo.toml:
[package]
name = "my-crate"
version = "0.1.0"
authors = ["My Name "]

[dependencies]
rusoto_core = "0.25.0"
rusoto_dynamodb = "0.25.0"

Rust code:
extern crate rusoto_core;
extern crate rusoto_dynamodb;

use std::default::Default;

use rusoto_core::{default_tls_client, DefaultCredentialsProvider, Region};
use rusoto_dynamodb::{DynamoDb, DynamoDbClient, ListTablesInput};

fn main() {
  let credentials = DefaultCredentialsProvider::new().unwrap();
  let client = DynamoDbClient::new(default_tls_client().unwrap(), credentials, Region::UsEast1);
  let list_tables_input: ListTablesInput = Default::default();

  match client.list_tables(&list_tables_input) {
    Ok(output) => {
      match output.table_names {
        Some(table_name_list) => {
          println!("Tables in database:");

          for table_name in table_name_list {
            println!("{}", table_name);
          }
        }
        None => println!("No tables in database!"),
      }
    }
    Err(error) => {
      println!("Error: {:?}", error);
    }
  }
}

debugging.html.body:
Debugging
Rusoto uses the log logging facade. For tests, Rusoto uses
env_logger.
In order to see logging output (e.g. the actual requests made to AWS),
env_logger needs to be initialized:
#[test]
fn list_objects_test() {
    let _ = env_logger::init(); // This initializes the `env_logger`

    let bare_s3 = S3Client::new(
        DefaultCredentialsProvider::new().unwrap(),
        Region::UsWest2
    );
    let mut list_request = ListObjectsRequest::default();
    list_request.bucket = "rusototester".to_string();
    let result = bare_s3.list_objects(&list_request).unwrap();
    println!("result is {:?}", result);
}

To see the output of logging from integration tests, the command needs to be run
as follows:
RUST_LOG=rusoto,hyper=debug cargo test --features all
To get the logging output as well as the output of any println! statements,
run:
RUST_LOG=rusoto,hyper=debug cargo test --features all -- --nocapture
If more debugging is required, all debug info including details from the compiler can be seen by setting RUST_LOG to debug.  This will be noisy but will give a lot of debug information.  For example:
RUST_LOG=debug cargo test --features all
